VARIATION: Carapace pars cephalica microsculpture varies from strongly granulate to smooth in the elevated portion of the carapace in both sexes; the sides are always moderately granulate (figs. 174, 
187, 188
). Some specimens lack modified setae over the paturon inner margin, while other specimens have a brush of these setae concentrated in the middle (figs. 177, 191–193). The spine number in legs I and II of both sexes varies widely among specimens: most have four spines on the prolateral surface and three on the retrolateral, but some specimens have only one or none.
